import pyDes
import base64

data = ""
k = pyDes.des('jeH3O1VX', pyDes.CBC, "nHnsU4cX", pad='pkcs7')
decryptstring = k.decrypt(base64.b64decode(data))
print(decryptstring)

decryptstring = str(decryptstring)
img_base64 = decryptstring.split(';base64,')[1]
imgdata = base64.b64decode(img_base64)
file = open('yzm.png', 'wb')
file.write(imgdata)
file.close()
